package org.jn.core.java.student.dawood.akram.weekly.week3;

public class PrintExcept3And7 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        for(int i=1;i<=10;i++) {
        	if(i==3||i==7) {
        		continue;
        	} else {
        		System.out.println(i);
        	}
        }
	}

}
